/* jshint esversion: 6 */
import React from 'react';
import {Map, Markers} from "react-amap";
const randomPosition = () => ({
    longitude: 100 + Math.random() * 20,
    latitude: 30 + Math.random() * 20
});
const randomMarker = (len) => (
    Array(len).fill(true).map((e, idx) => ({
        position: randomPosition()
    }))
);

export default function test(){

    const [count,setCount] = React.useState({markers:'lat:53,lng:-6',center:'lat:53,lng:-6'});
    const randomMarkers=function (){
        setCount({markers: randomMarker(100)});
    };

    return(
            <div>
            <div style={{width: '100%', height: 372}}>
                <Map plugins={['ToolBar']} center={count.center} zoom={6}>
                    <Markers
                        markers={count.markers}
                    />
                </Map>
            </div>
            <button onClick={randomMarkers.bind(this)}>Random Markers</button>
        </div>
        )
}
